import './navitems.css'



const NavItem = (props) => {
  return (
<li><a >

    {props.children}
    </a>
</li>
  )
}




const NavItemDropDown = (props) => {
    return (
  <li><a className='nav-item'>
  {props.children}
  </a></li>
    )
  }

export default NavItem
export {NavItemDropDown}
